import React, { Component } from 'react';


export class Education extends Component {
    render() {
        return (
            <div style={main}>
                <h2 style={headingText}>Education</h2>

                <h1 style={subHeadingText}>Current University</h1>
            </div>

        )
    }

}

const main = {
    display: 'flex',
    flexDirection: 'column',
    height: '100vh',
    backgroundColor: "#62f0a4"
};

const headingText = {
    marginLeft: '20px',
    fontSize: '3rem',
    color: '#ffffff'
}

const subHeadingText = {
    marginLeft: '20px',
    fontSize: '2rem',
    color: '#ffffff'
}

export default Education;
